import csv


def graphExtractor(ls):
    
    data, high, low = ls
    points = data.split(" ")
    
    x_points = []
    rescaledPoints = []
    counter = 0
    
    for point in points:
        if point == 'M' or point == 'L':
            continue
        
        if counter % 2 != 0:
            x_points.append(float(point))
        
        counter += 1
    
    difference = max(x_points) - min(x_points)
    for point in x_points:
        
        rescaledPoints.append(round( ((1-((point- min(x_points))/difference)) * (high - low)) + low , 4 ))
        
    return rescaledPoints



